import React, { useState, useEffect } from 'react';

const ProjectsPage: React.FC = () => {
  const [projects, setProjects] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch('/api/projects')
      .then(res => res.json())
      .then(data => {
        setProjects(data.projects);
        setLoading(false);
      })
      .catch(err => {
        console.error('Failed to load projects:', err);
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="p-8">Loading work queue...</div>;

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Work Queue - Paid Projects</h1>
      <div className="bg-white rounded-lg shadow p-6">
        {projects.length > 0 ? (
          <div>
            {projects.map(project => (
              <div key={project.id} className="border-b py-4">
                <p><strong>Contractor:</strong> {project.contractor.companyName}</p>
                <p><strong>Property:</strong> {project.propertyAddress}</p>
                <p><strong>Status:</strong> {project.status}</p>
                <p><strong>Cost:</strong> ${project.totalCost}</p>
              </div>
            ))}
          </div>
        ) : (
          <p>No projects in queue</p>
        )}
      </div>
    </div>
  );
};

export default ProjectsPage;
